\'3fChapter 32. Cooperatives
Scope StatementThis chapter contains forms of and relating to the organization of cooperative associations, as well as forms of marketing agreements for use by agricultural cooperatives. The chapter also contains a discussion of legal principles, including tax aspects, 
that should be considered when drafting these organizing instruments and marketing agreements.
