32:1. Definitions
Research References\'3fWest's Key Number Digest, Associations &key;101et seq.\'3fA &ldquo;\'93cooperative corporation&rdquo;\'94is an organization created by the banding together of persons for their common advantage or advancement, financial or otherwise, and is organized for the mutual benefit of its members, without gain to itself.11\'3f\'3fSee \'3fCoop. Corp. Law &s;\'a713.
Research References\'3f
