The most common type of cooperative corporation is the nonprofit agricultural cooperative corporation and the New York statutes expressly provide for the organization of such corporations.22\'3f\'3fSee \'3fCoop. Corp. Law &ss;\'a7\'a7110 et seq.Research ReferencesAgricultural cooperative corporations, \'3fN.Y. Jur. 2d, Business Relationships &s;\'a730.
\'3fCooperative corporations are distinguished from other business structures by the features of democratic control and voting, the distribution of economic benefits on an equal basis or in proportion to the use made of the corporation facilities, limited ret
urn on capital, and the fact that most of the cooperative's business is done with its own members.3
3\'3f\'3fSee \'3fCoop. Corp. Law &s;\'a714for a list of the general powers of a cooperative corporation.
Research ReferencesAgricultural cooperative corporations, \'3fN.Y. Jur. 2d, Business Relationships &s;\'a730.
