It should be noted that federal legislation authorizing associations of agricultural producers applies only to corporations that, inter alia, allow only one vote per member, or that do not pay dividends on stock or membership capital in excess of 12
&percnt;%per year. The New York statute establishes these criteria.44\'3f\'3fSee \'3fCoop. Corp. Law &ss;\'a7\'a744, 111.
