B. Tax Aspects
1. Federal Tax
32:3. In general
Research References\'3fWest's Key Number Digest, Internal Revenue &key;3985 to 3988\'3fWest's Key Number Digest, Internal Revenue &key;4059\'3fFor federal income tax purposes, cooperatives are classified either as exempt farmers' cooperatives or nonexempt cooperatives. An &ldquo;\'93exempt farmers' cooperative&rdquo;\'94is an association of farmers, fruit growers, or the like, organized and operated on a cooperative basis for the purpose of marketing the products of members or other producers and turning back to them the proceeds of sales, less the necessary marketing e
xpenses, on the basis of either the quantity or the value of the products furnished by them; or purchasing supplies and equipment for the use of members or other persons and turning over such supplies and equipment to them at actual cost plus necessary expenses.11\'3f\'3f\'3f26 U.S.C.A. &s;\'a7521(b)(1).
Research ReferencesAgricultural and horticultural organizations, \'3fFederal Tax Coordinator 2d &pp;D-4700 to D-4705.
Cooperatives, \'3fFederal Tax Coordinator 2d &pp;E-1000 to E-1150.
Farmers' cooperatives, \'3fFederal Tax Guide to Legal Forms &ss;\'a7\'a75:17to 5:20.
\'3fA &ldquo;\'93nonexempt cooperative&rdquo;\'94can be defined as one that does not meet the requirements of an exempt farmers' cooperative either because it engages in occupations dissimilar to those of farmers, fruit growers, and the like22\'3f\'3f\'3f26 C.F.R. &s;\'a71.521-1(d).
Research ReferencesWhat cooperative exemption means, \'3fFederal Tax Coordinator 2d&p;E-1002.
Nonexempt farmers cooperatives, \'3fFederal Tax Guide to Legal Forms &ss;\'a7\'a75:17 to 5:19.
or because it fails to satisfy some other requirement.33\'3f\'3fSee, generally, \'3f26 C.F.R. &s;\'a71.521-1.
Most other cooperative corporations are generally taxable as ordinary business corporations, except that they may exclude from their income earnings distributed as patronage dividends.44\'3f\'3f\'3f26 U.S.C.A. &ss;\'a7\'a71381(a), 1382(b).
Research ReferencesFor general discussion of taxation of cooperatives, see \'3fFederal Tax Guide to Legal Forms &ss;\'a7\'a75:17to 5:20and \'3fFederal Tax Coordinator 2d &pp;E-1000 to E-1045.
This chapter is concerned primarily with exempt farmers' cooperatives.
