II. Outlets and Proposed Marketing Methods:\'3f\'3f\'3f\'3f
1. Often it is advisable to confine marketing operations to one trade group, i.e., retailers or wholesalers. Trying to sell to several groups may arouse antagonism from one or other of established business groups. What should the committee suggest in this
respect?\'3f\'3f
\'3f
2. What reception should the cooperative expect from potential customers and competitors now in business?\'3f\'3f\'3f
3. Will the cooperative establish its own place of business with a complete sales and delivery force, or will it employ an agent on a contract basis?\'3f\'3f\'3f
4. Will the policy be to market a uniform product that can be standardized under supervision of the cooperative management, and labeled and advertised as a cooperative product, or to act as an agent for produce packed on the members' farms?\'3f\'3f\'3f5. What will be price policy on sales?\'3f\'3f
III. Organization and financing:\'3f\'3f\'3f1. Where will the place, or places, of business be established?\'3f\'3f
\'3f
2. What should the scope of the cooperative be? How many products will the cooperative attempt to handle at the beginning? Later?\'3f\'3f
\'3f
3. From how big an area will members be accepted? The state? One country? One district?\'3f\'3f\'3f
4. What should the name of the cooperative be?\'3f\'3f\'3f
5. Financing: Will the cooperative be incorporated or not? Will it be a stock organization by which capital is raised from the sale of interest-bearing stock certificates, or a nonstock cooperative that requires only membership fees? Usually this is decid
ed by the amount of capital required.\'3f\'3f
\'3f
6. Membership: Will there be any limitation on the least volume of business that possible members will give to the cooperatives?\'3f\'3f\'3f7. How many potential members are there, and how many of them will join a cooperative?\'3f\'3f
\'3f
8. What will be the membership fee?\'3f\'3f
\'3f
9. What plan is proposed to secure maximum membership?\'3f\'3f\'3f
10. Will the cooperative do business with nonmembers? To what extent?\'3f\'3f\'3f11. How will the Board of Directors be chosen? On the basis of size of business, by districts, at large, or a combination? What fees and expenses will be paid to Directors?\'3f\'3f\'3f
12. Manager: What type of manager will be employed? At what salary? What will his or her duties and authority be in relation to the Board of Directors?\'3f\'3f\'3f
13. What reports will the manager and Board of Directors give to members? How often?\'3f\'3fIV. Marketing Agreement:\'3f\'3f\'3f
