Notes to FormTax Notes 
\'3fUnlike other nonspecific types of cooperative organizations, an agricultural cooperative is defined with precision by the Code, regulations, rulings, and cases. Two kinds of agricultural co-ops qualify as 
&ldquo;\'93tax-exempt.&rdquo;\'94The term is placed in quotes for a reason. While these organizations are stated to be &ldquo;
\'93exempt from taxation&rdquo;\'94under \'3f26 U.S.C.A. &ss;\'a7\'a7521, farmers' cooperatives are still required to be pay taxes specified in \'3f26 U.S.C.A. &s;\'a71381 et seq.,26 U.S.C.A. &s;\'a71381 then requires them to pay the ordinary income tax and capital gains tax levied by. 26 U.S.C.A. &s;\'a7&s;\'a711 and 1201. Section 1381 then goes on to say that in spite of these taxes being levied against agricultural cooperatives, they are considered to be exempt from income taxes for any purpose in which the law refers to exempt organizations.
\'3fThe two types of agricultural cooperatives that are recognized are the marketing co-op and the purchasing co-op. The requirements for these organizations are found at \'3f26 U.S.C.A. &s;\'a7521(b)(1), (4).
\'3fThe result is that an agricultural cooperative is entitled to a special deduction for patronage dividends, dividends on capital stock, and certain other distributions. Otherwise, they pay tax under the regular rules that relate to ordinary income and capi
tal gain. They are not permitted the dividends-received deduction and may not use the consolidated return provisions. \'3f26 C.F.R. &s;\'a71.522-1(a).
