\'3f\'3fBYLAWS OF [NAME OF CORPORATION]\'3fARTICLE I  NAME AND HEADQUARTERS
\'3fSection 1. Name. 
\'3fThe name of the cooperative shall be [name of cooperative], referred to in these bylaws as &ldquo;\'93Cooperative.&rdquo;\'94\'3fSection 2. Headquarters. 
\'3fThe headquarters of the cooperative shall be located at [address of cooperative], [name of city], 
[name of county], State of New York.
\'3fARTICLE II  FUNCTIONS AND OBJECTIVES
\'3fSection 1. Business. 
\'3fThe business to be carried on by the cooperative shall be [description of business].
\'3fSection 2. Other Objectives. 
\'3fOther objectives of the cooperative shall be:
\'3f(a). 
\'3fcooperative service for the benefit of the members and of the consuming public;
\'3f(b). 
\'3faffiliation or cooperation with other cooperative organizations of a like nature in the local community, the state, the nation and other countries;
\'3f(c). 
\'3fpromotion of the cooperative ideal through educational activities; and
\'3f(d). 
\'3fsuch other objectives as may be set out in the certificate of incorporation.
\'3fARTICLE III  MEMBERSHIP
\'3fSection 1. Eligibility. 
\'3fAny person, irrespective of age, sex, race, nationality, political opinion, or religious belief, and any firm, partnership, or corporation, including both landlords and tenants in share tenancies, who is engaged in the production of [name of agricultural product]in the territory in which the corporation is engaged in business, who agrees to be a patron of the corporation, and who pays such membership fees and meets such other conditions as may be prescribed by the board of directors is eligible to become a
member of this cooperative.
\'3fSection 2. Number. 
\'3fThe number of members of the corporation shall be limited to [number of members].
\'3fSection 3. Fees, operating, and other charges. 
\'3fa. Fee Required. 
\'3fEach person on becoming a member of the corporation will pay to the corporation a fee of $[dollar amount of fee]
, of which amount $[dollar amount of annual subscription]shall be in payment of [number of years]year's subscription to [[name of publication]/[name of other similar publication of cooperative]]and the balance of which shall be applied to [specification of intended use of balance amount].
\'3fThe corporation's operating expenses shall be met by a percentage charged on returns for products sold and by a percentage charged on supplies purchased, the amount of such charges to be fixed by the board of directors. Payment for the expenses will be ma
de on the first day of each month.
\'3fb. Payment of Fee and Membership Shares. 
\'3fThe fee must be paid in cash. A membership share may be paid for by:
\'3f(1). 
\'3fPayments in lawful money of the United States;
\'3f(2). 
\'3fApplication of patronage refund;
\'3f(3). 
\'3fCredit of interest of other debts due; or
\'3f(4). 
\'3fAny combination of the above.
\'3fSection 4. Property Rights of Members. 
\'3fThe corporation will not have any capital stock. The following membership rights, privileges and restrictions shall apply:
\'3fa. 
\'3fA member shall be entitled to only one vote and that only after the member has purchased one membership share. The full $[dollar amount of fee]must be paid (see Subsection 3b above) within a period of [number of months]months from the date of application. On failure to make such timely payment, the amount of the member's credit shall, at the discretion of the board of directors and after [number of days]days' notice by [registered mail/[specification of mode of delivery]]to the member at the member's last-known address, be refunded and the membership cancelled. If a member cannot be located, the amount shall be applied to the work of [name of committee]
.
\'3fb. 
\'3fEach member's patronage refund and share dividends shall be credited to the member as payment on membership shares until the member owns [number of shares]shares, and thereafter the member's patronage refunds and share dividends, if their combined total is $
[dollar amount of combined total]or more, shall be paid in cash unless the member gives other directions, provided, however, that the patronage refund shall be paid in the manner and to the extent required by the Internal Revenue Code and Treasury Depa
rtment Regulations to qualify for income tax deductions or exclusions for this cooperative. Patronage refunds and share dividends not paid out shall be applied toward purchase of additional shares.
\'3fc. 
\'3fDividends shall be paid on membership shares as provided below and shall accrue from the first day of the first full month during which a member owns at least [number of membership shares]membership shares. For all purposes relating to the payment of dividends, all shares purchased by a member not later than the [ordinal number of day]
day of any month shall be deemed to have been owned by the member on the first day of that month.
\'3fd. 
\'3fA member may not hold more than [percentage of total membership shares]&percnt;%of the total of all membership shares issued and outstanding at any one time.
\'3fe. 
\'3fMembership shares are nontransferable except within a member's family and then only on approval of the board of directors after written request for such transfer.
\'3ff. 
\'3fThe board of directors may, after written notice by first class mail, recall, at par value, the membership shares and terminate the membership of any member who has failed to patronize or participate in the organizational activities of the cooperative for
at least one year.
\'3fg. 
\'3fFor the purpose of this paragraph, &ldquo;\'93family&rdquo;\'94shall be defined as those individuals living in one household as the single purchasing unit. Individuals wishing to be grouped in such purchasing unit must so inform the cooperative in writing.
\'3fh. 
\'3fEach person who becomes or remains a member of this cooperative after the adoption of this bylaw (ARTICLE III, Section 4h) consents to include in [his/her]gross income for federal income tax purposes the amount of any patronage refund paid to him or her by this cooperative by written notice of allocation (as defined in the Internal Revenue Code), except to the extent that such a patronage refund is not inc
ome to the member because: (1) it is attributable to the purchase of personal, living, or family items; or (2) it should be properly treated as an adjustment to the tax basis of property previously purchased. The term &ldquo;\'93patronage refund&rdquo;\'94as used herein shall have the same meaning as that term is used in the Internal Revenue Code.
\'3fSection 5. Liability for Debts of Cooperative. 
\'3fMembership shares are nonassessable. A member of this cooperative shall not be liable for the debts of the corporation to an amount exceeding the sum remaining unpaid on the membership fee or subscription to the capital stock, including any unpaid balance
on any promissory notes given in payment.
\'3fSection 6. Withdrawal of Amounts Credited on Purchase of Membership Shares. 
\'3fA member may withdraw, partially or wholly, amounts credited toward the purchase of membership shares, subject to the following provisions:
\'3fa. 
\'3fMember must submit written notice to the cooperative of intent to withdraw share credits.
\'3fb. 
\'3fComplete withdrawal necessitates resignation from membership.
\'3fc. 
\'3fResignation from membership is effective when approved by the board of directors.
\'3fd. 
\'3fPartial withdrawal is permitted only if at least [number of membership shares to be retained]membership shares are retained.
\'3fe. 
\'3fCredits shall be reduced proportionately if the total membership share credits of all members are impaired.
\'3ff. 
\'3fMember agrees to accept payment in goods or services purchased from the cooperative or in cash at the election of the cooperative.
\'3fg. 
\'3fPayment shall be made within one year from date of receipt of notice of intent, providing such payment will not, in the opinion of the board of directors, unduly impair the finances of the cooperative.
\'3fSection 7. Suspension or Termination. 
\'3fIf, following a hearing, the board of directors finds that a member has ceased to be an eligible member; has not, for a period of [number of years]years, marketed through the corporation the products covered by the marketing agreement or agreements with the corporation or has not otherwise patronized the corporation; has moved out of the territory in which the corporation is operating; or has died 
or has withdrawn or resigned from the corporation, the board may suspend such member's rights as a member or terminate the membership. On termination ofmembership in the corporation, the membership certificate will be cancelled, all rights and interests of such member in the corporation will cease, and the member will be entitled only to payment or credit for the equitable appraised value of the member'
s property rights and interests in the corporation, as conclusively determined by the board of directors. In determining property rights and interests, all amounts allocated to each member or evidenced by certificates of any kind will be excluded, and any
such amounts will be accounted for to members in accordance with the applicable terms and conditions. No action taken under this section will impair the obligations or liabilities of either party under any contract with the corporation, which may be termin
ated only as provided in these bylaws.
\'3fSection 8. Method of Resignation. 
\'3fAfter a person has been a member of the corporation for [number of years]years, the member may withdraw or resign from the corporation in any year on the last day of the anniversary month in which such member was accepted as a member by notifying the corporation of the intention to withdraw or resign, such notice to be given 
between the [ordinal number of day]and the [ordinal number of day]of the month immediately prior to the effective date of withdrawal or resignation. If the member fails to withdraw or resign in any year, as stated above, it is agreed that such failure will constitute conclusive evidence that the member has renewed membership in the corporation for another year.
\'3fARTICLE IV  BUSINESS PRINCIPLES AND PRACTICES
\'3fSection 1. Governing Principles. 
\'3fThe business of this cooperative shall be conducted according to the following principles:
\'3fa. Democratic control. 
\'3fThere shall be one vote for each member. Voting by proxy is not permitted.
\'3fb. Open membership. 
\'3fMembership is open to all producers of [name of agricultural product]acting in good faith without regard to age, sex, race, nationality, political opinion, or religious belief.
\'3fc. Limited dividends on capital. 
\'3fIn accordance with New York laws governing cooperative corporations, dividends on membership shares, if earned and declared, shall not exceed [percentage of maximum dividends on membership shares]&percnt;%per year.
\'3fd. Cash sales at prevailing prices. 
\'3fGoods and services shall be supplied to patrons at prevailing prices of the neighborhood. All sales shall be on a cash basis.
\'3fe. Patronage refunds based on purchases. 
\'3fThe distribution of all patronage refunds shall be on the basis of amount of purchases.
\'3ff. Education and promotion. 
\'3fFunds shall be provided for education and promotion.
\'3fg. Neutrality. 
\'3fThe cooperative shall be neutral in religion and politics.
\'3fh. Business with nonmembers. 
\'3fIn any fiscal year, the value of business done with nonmembers shall not exceed the value of business done with members during the same period.
\'3fSection 2. Fiscal Year. 
\'3fThe fiscal year shall end on the [day of week]nearest to the [ordinal number of day]day of [name of month]. The succeeding fiscal year shall begin on the following [day of week].
\'3fSection 3. Net Surplus Savings and Earnings. 
\'3fAt the end of each fiscal year, the net surplus savings and earnings of the cooperative (referred to as net earnings) shall be determined and applied as follows:
\'3fa. 
\'3fCapital shall be restored to the extent of any impairment thereof.
\'3fb. 
\'3fAn amount equal to [percentage of net earnings]&percnt;%of net earnings shall be set aside as a reserve fund until such fund shall equal an amount representing [percentage of total membership shares outstanding]
&percnt;%of the total membership shares outstanding.
\'3fc. 
\'3fDividends at the rate of [percentage rate of dividends]&percnt;%per annum shall be paid on membership certificates to all members who own at least [number of membership certificates]membership certificates, provided, however, that not more than [percentage of net earnings]&percnt;%of the net earnings shall be paid out as dividends on membership shares. In the event [percentage of net earnings]
&percnt;%of the net earnings is insufficient to pay dividends as provided above at the rate of [percentage rate 
of dividends]&percnt;%, the rate shall be determined by dividing a sum equal to [percentage of net earnings]
&percnt;%of the net earnings by the aggregate face value of all certificates on which dividends are payable under these bylaws.
\'3fd. 
\'3fPatronage refunds shall be paid as follows:
\'3f(1). 
\'3fPatronage refunds shall be paid on recorded sales. The board of directors shall, from time to time, provide the method and procedure by which business transacted with the cooperative by its patrons shall be recorded by the cooperative. Each patron shall b
e responsible for meeting all requirements as established pertaining to participation in keeping such patronage records. The sales and other business transactions so entered in the patronage records of the cooperative shall constitute recorded sales.

\'3f(2). 
\'3fThe amount available for payment of such refunds shall be: (a) that proportion of net earnings which the &ldquo;\'93recorded sales&rdquo;\'94of the cooperative bears to the total sales of the cooperative for the fiscal year; or (b) total net earnings for the fiscal year, less the amount paid to the restoration of capital, the reserve fund, and the payment of dividends on membership certificat
es, as required by law or by these bylaws, whichever is the smaller.
\'3f(3). 
\'3fThe rate or percentage of such refunds shall be determined by dividing the amount available for payment of refunds by the recorded sales of the cooperative for the fiscal year.
\'3f(4). 
\'3fOn written authorization from a member, $[dollar amount of sum payable]of the sum payable to such member as dividends or as a patronage refund at the end of any fiscal year may be retained by the cooperative in payment of a year's subscription to &ldquo;\'93[name of publication]&rdquo;\'94or other similar publication of the cooperative.
\'3fSection 4. Computation of Net Earnings. 
\'3fFor the purpose of this article, the net earnings of the cooperative shall be computed:
\'3fa. 
\'3fBefore dividends on shares;
\'3fb. 
\'3fAfter provisions for federal income tax; and
\'3fc. 
\'3fAfter allocating to the reserve fund the net amount, after federal income taxes, of any gains or losses resulting from the sale or exchange of land, buildings, or equipment, provided the net gain or loss from all such sales or exchanges exceeds $
[dollar amount of minimum net gain or loss]for the taxable year.
\'3fARTICLE V  GOVERNMENT AND MANAGEMENT
\'3fSection 1. Membership Control. 
\'3fThe control of the cooperative shall be vested in the membership.
\'3fSection 2. Function of Membership Meetings. 
\'3fThe function of the membership meetings shall be primarily:
\'3fa. 
\'3fTo consider legislation.
\'3fb. 
\'3fTo conduct elections.
\'3fc. 
\'3fTo discuss policies and problems of administration and management.
\'3fd. 
\'3fTo make recommendations to the board of directors.
\'3fe. 
\'3fTo consider educational programs.
\'3fSection 3. Administration by Board of Directors. 
\'3fThe administration of the cooperative is vested in a board of directors responsible to the membership.
\'3fSection 4. Education Committee. 
\'3fEducation activities shall be administered by the board of directors through an education committee.
\'3fSection 5. General Manager. 
\'3fManagement of the business of the cooperative shall be vested in a general manager selected by and responsible to the board of directors. All regular employees subordinate to the general manager shall be engaged through nomination by the general manager a
nd approval by the board of directors. The duties of the general manager shall be as follows:
\'3fa. 
\'3fTo conduct the ordinary and usual business of the corporation, including the purchasing, marketing, and handling of all products and supplies handled by the corporation.
\'3fb. 
\'3fTo conduct such business in a manner that the members and patrons will receive just and fair treatment.
\'3fc. 
\'3fTo deposit all money belonging to the corporation that comes into the general manager's possession in the name of the corporation in a bank selected by the board of directors and, if authorized to do so by the board of directors, to make all disbursements
by check from such account for the ordinary and necessary expenses of the business in the manner and form prescribed by the board of directors.
\'3fd. 
\'3fTo maintain all records and accounts in such a manner that the true and correct condition of the business may be ascertained at any time and to render annual and periodic statements in the form and manner prescribed by the board of directors.
\'3fe. 
\'3fSubject to the approval of the board of directors, to employ, supervise, and dismiss employees of the corporation but not agents or counsel specifically employed by the board of directors.
\'3fSection 6. Annual Audit. 
\'3fAn annual audit of accounts and a complete financial report shall be made at the annual membership meeting by an auditor selected by the board of directors.
\'3fSection 7. Delegates to Other Organizations. 
\'3fDelegates to [name of organization]or to any similar society of which this cooperative is a member shall be elected, each for a term of one year, by the board of directors.
\'3fARTICLE VI  MEMBERSHIP MEETINGS
\'3fSection 1. Date of Meetings. 
\'3fRegular membership meetings shall occur [specification of time interval]in [name of month 1]and 
[name of month 2].
\'3fSection 2. Time and Place. 
\'3fThe time and place of each regular meeting shall be set by the board of directors. At least [number of days]-days prior to the date of any of these meetings, notice of the meeting, containing the time and place, shall be mailed to all members by the secretary or other person designated by the board of directors.
\'3fSection 3. Order of Business. 
\'3fThe order of business at regular meetings shall consist of:
\'3fa. 
\'3fRoll call
\'3fb. 
\'3fProof of due notice of meeting
\'3fc. 
\'3fReading of minutes
\'3fd. 
\'3fPresident's report
\'3fe. 
\'3fManager's report
\'3ff. 
\'3fTreasurer's report
\'3fg. 
\'3fAuditor's report (at annual meetings only)
\'3fh. 
\'3fCommittee reports
\'3fi. 
\'3fElections as required in the bylaws
\'3fj. 
\'3fUnfinished business
\'3fk. 
\'3fNew business
\'3fl. 
\'3fAdjournment
\'3fSection 4. Special Meetings. 
\'3fSpecial meetings may be called by the board of directors. The meeting must be called by the secretary within [number of days]days after a written petition for such meeting, stating the time, place, and specific business to be discussed and signed by [percentage of voting members]&percnt;%of the voting members, has been presented to the secretary setting forth the meeting's purpose.
\'3fSection 5. Notice of Meetings. 
\'3fWritten or printed notice of every regular or special meeting of the members will be prepared and mailed to the last-known post office address of each member not less than 10 days before the meeting. The notice will state the purposes of the meeting and t
he time and place that it is to be held. No business will be transacted at special meetings other than that referred to in the call.
\'3fSection 6. Quorum. 
\'3fAt any membership meeting, the presence of [number of persons having voting rights]persons having voting rights, or such lesser number of persons as shall equal [percentage of all members having voting rights]&percnt;%of all members having voting rights, shall constitute a quorum for the transaction of business. If balloting is conducted by mail on any issue or election, the number of members voting by mail shall be included in determining whether quorum requirements 
are satisfied with respect to matters included on the mail ballot.
\'3fSection 7. Identification Card. 
\'3fAt all business meetings, the secretary shall issue to each voting member, preferably at the time of entrance, an identification card, which shall be used in all show of hands or ballot voting.
\'3fSection 8. Voting by Mail. 
\'3fIn the event it shall be deemed advisable, the board of directors in the first instance, or when directed to do so at a membership meeting, may conduct a vote of the membership by mail on a specific issue or issues or an election. The procedure for conducting such balloting shall be established by the board of directors according to law.
\'3fARTICLE VII  DIRECTORS AND OFFICERS
\'3fSection 1. Number of Directors; Election. 
\'3fThe board of directors shall consist of [number of members]members. Each director shall be a member of the corporation in good standing, and a person will not be eligible to become a director if he or she is in competition with or is affiliated with any enterprise that is in competition with the corporation. Eac
h year at the [name of month]membership meeting, [number of directors]directors shall be elected from the nominees presented by the nominating committee or from the floor, each for a term of one year or until a successor is elected. Any member with voting rights is eligible for directorship except employees and members of their immediate families. At least two nominees will be nominated for each directorship. All directors will be elected by secre
t ballot and the nominee with the greatest number of votes will be elected.
\'3fSection 2. Alternate Members. 
\'3fEach year at the [name of month]meeting of the membership, there shall also be elected [number of alternate members]alternate members of the board. These members shall be the next [number of remaining members]remaining nominees for the board of directors having the highest vote after all vacancies on the board of directors have been filled. They shall have the privilege of participating in the discussion but have no power to vote. In case of an absence of a r
egular director at a given board meeting, the chairperson shall appoint the alternate present who received the highest number of votes to function as a director at the meeting. If a second regular director is absent from the given board meeting, the chairperson shall appoint the alternate present who
received the second highest number of votes to function as a director at such meeting. Should a third regular director be absent from the given board meeting, the chairperson shall appoint the alternate who received the third highest number of votes to f
unction as a director at such meeting. In case of a vacancy on the board, the board shall select one of the alternates to serve during the vacancy but not beyond the next 
[name of month]meeting.
\'3fSection 3. Meetings; Quorum. 
\'3fThe directors shall have regular monthly meetings, and [number of directors]shall constitute a quorum for official business. A majority of the [total number of directors]
directors is required for official action. All meetings shall be open to the members of the cooperative.
\'3fSection 4. Absence from Meetings. 
\'3fAny director who is absent from [number of consecutive meetings]consecutive meetings of the board shall be dropped from the board at the next meeting unless excused by vote of the board, provided that the director shall have been notified of the situation by the secretary, such notice to be given after a director has
missed [number of consecutive meetings]consecutive meetings.
\'3fSection 5. Special Meetings. 
\'3fA special meeting of the board of directors will be held whenever called by the president or by a majority of the directors. Any business may be transacted at a special meeting. Each call for a special meeting will be in writing, signed by the person or p
ersons calling for the meeting, addressed and delivered to the secretary, and will state the time and place of the meeting. On the signing of a waiver of notice of a meeting, a meeting of the board of directors may be held at any time.
\'3fSection 6. Compensation. 
\'3fThe compensation, if any, of the members of the board of directors and of the executive committee will be determined by the members of the corporation at any regular or special meeting of the corporation. No member of the board of directors will occupy an
y position in the corporation on regular salary. The compensation, if any, of the corporation's officers will be determined by [specification of determination method].
\'3fSection 7. Election of Officers. 
\'3fAt the first meeting of the directors after each [name of month]membership meeting, the directors shall elect as officers of the cooperative [OPTIONAL: from among the directors]
a president and a vice president. The directors shall also elect a treasurer and a secretary (or a secretary&ndash;-treasurer), who may, but need not, be members of the board or members of the cooperative.
\'3fSection 8. Duties of Officers. 
\'3fThe duties of the officers shall be as follows:
\'3f(a). Duties of the president. 
\'3fThe president shall preside over all meetings of the corporation and of the board of directors; call special meetings of the board of directors, as required; perform all acts and duties and render such reports as are usually required of an executive and p
residing officer; sign certificates for shares or membership of the corporation and such other documents as the president may be authorized or directed to sign by the board of directors; and perform such other duties as the board of directors may prescrib
e.
\'3f(b). Duties of the vice president. 
\'3fIn the absence of disability of the president, the vice president shall perform the duties of the president.
\'3f(c). Duties of the secretary. 
\'3fThe secretary shall keep a record of all meetings of the corporation and of the board of directors; keep complete membership records and have general charge of the corporation's books and records; sign all membership or stock certificates with the preside
nt and sign such other papers as the secretary may be authorized or directed to sign by the board of directors; serve all notices required by law and these bylaws and make all reports required by law; keep the corporate seal and all books of blank certifi
cates complete; and affix the corporate seal to all papers requiring such seal.
\'3f(d). Duties of the treasurer. 
\'3fThe treasurer will perform such duties with respect to the finances of the corporation as may be prescribed by the board of directors.
\'3fSection 9. Powers of Directors. 
\'3fThe board of directors shall have full power in administrating the cooperative's affairs and may make such rules and regulations with respect to the business and employees of the cooperative as the board deems advisable, provided that all actions shall be
consistent with these bylaws.
\'3fSection 10. Committees. 
\'3fThe president shall appoint the following standing committees of the board immediately after taking office: [names of standing committees], as well as such other special committees as may be deemed necessary by the board of directors.
\'3fSection 11. Loans Involving Mortgages. 
\'3fThe board shall not accept any loan involving a mortgage on any of the property of the cooperative, except as authorized at a membership meeting with previous notice of the proposed loan.
\'3fSection 12. Other Loans. 
\'3fa. 
\'3fThe cooperative, by action of the board of directors, may accept other loans, provided such loans do not in the aggregate exceed the cooperative's net worth, except as authorized at a membership meeting with previous notice of the proposed loan or by mail
ballot.
\'3fb. 
\'3fLoans from members and others shall be solicited only when sufficient capital cannot be obtained from membership shares.
\'3fSection 13. Bonds. 
\'3fFidelity bonds shall be required of the treasurer and manager.
\'3fSection 14. Suggested Order of Business. 
\'3fSuggested order of business at regular meetings of the directors is:
\'3fa. 
\'3fMinutes of the preceding meeting
\'3fb. 
\'3fUnfinished business
\'3fc. 
\'3fCommunications and bills
\'3fd. 
\'3fReports of officers
\'3fe. 
\'3fReport of manager
\'3ff. 
\'3fReports of committees
\'3fg. 
\'3fNew business
\'3fARTICLE VIII  NOMINATIONS AND ELECTIONS
\'3fSection 1. Limitation on Consecutive Terms. 
\'3fNo member shall be elected as a director for more than [number of consecutive full terms]consecutive full terms.
\'3fSection 2. Nominating Committee. 
\'3fA nominating committee of [number of members]members shall be elected annually at the [name of month]membership meeting.
\'3fSection 3. Nominations by Committee. 
\'3fThe nominating committee shall make nominations for all positions, whether as regular or alternate directors, to be filled by election of the members. It shall submit a list of such nominations, the number of which shall be at least [percentage of total number of positions to be filled]&percnt;%greater than the total number of positions to be filled, to the secretary of the cooperative by the 
[day of week]following the [ordinal number of day][day of week]of [name of month]
. The committee may not nominate any of its own members. Such members may, however, be nominated by petition or from the floor, as provided by Section 4 of this ARTICLE.
\'3fSection 4. Nomination by Members. 
\'3fNominations may also be made by petition of [number of members]or more members submitted to the secretary of the cooperative by the [ordinal number of day]of [name of month]in any year. Such nominees will be provided equal opportunity with other nominees to present their views. Each voting member of record shall be notified of all nominations not less than [number of days]days before an election is held and shall be informed which nominations were made by the committee and which by petition. Additional nominations may be made from the floor.
\'3fARTICLE IX  MANAGERS AND EMPLOYEES
\'3fSection 1. Manager's Authority. 
\'3fThe manager shall be in full charge of the business of the cooperative but shall conduct the business in conformity with policies determined by the board of directors and the membership and in accordance with regulations and instructions of the board of directors as the administr
ative agency of the cooperative.
\'3fSection 2. Reports to Board; Financial Statements. 
\'3fThe manager shall attend all meetings of the board of directors and shall make such reports as are desired by the board. The manager shall prepare and submit a monthly financial statement to the board.
\'3fSection 3. Report to Membership; Inventories. 
\'3fThe manager shall attend membership meetings and make such reports as are requested by the president or by action taken in membership meetings. In [name of month of semi-annual inventory], the manager shall take a complete inventory. At the [name of month]meeting of the directors and at the [name of month]membership meeting, the manager shall present a statement of operations and a balance sheet. At the [name of month]meeting of the directors and the [name of month]membership meeting, the manager shall make corresponding reports for the year. In each case, the manager shall have available copies for inspection by anyone interested, and a permanent copy shall be filed in the cooperative's registered office.
\'3fSection 4. Employee Grievances. 
\'3fAny employee or representative of the employees shall have the right to present any grievances directly to the board of directors.
\'3fSection 5. Suspension of Employees. 
\'3fThe manager must give an employee [number of days]days' notice of intention of terminating that employee's services. For serious cause, such as dishonesty or other immoral conduct, the board of directors may immediately suspend an employee. In either case, the employee shall have the right of a hearing 
before the board and the right of appeal from the decision of the board as provided in Section 4 of ARTICLE X on initiative and referendum. This section shall be subject to any agreement that this cooperativ
e shall have entered into with any labor union.
\'3fARTICLE X  PATRONS AND PATRONS' NET MARGINS
\'3fSection 1. Patrons. 
\'3fEach patronage transaction between this corporation and each patron will be subject to and will include as a part of its terms each provision of this ARTICLE X, whether it be expressly referred to in the transaction or not, and no person shall have any au
thority to transact any business for this corporation with any patron on any terms inconsistent with this ARTICLE X. On selling, consigning, or otherwise delivering any agricultural product to this corporation or contracting to do so and on buying or othe
rwise receiving any farm supplies or equipment from this corporation or contracting to do so, each patron, with or without then executing any writing or doing any other act, thereby:
\'3f(a). 
\'3fShall, as further consideration due the patron from this corporation on account of such transaction, become entitled to have paid such proportion of the patrons' net margins received by this corporation as such patronage bears to the aggregate patronage o
f all patrons, as is in this document more particularly defined and provided; and
\'3f(b). 
\'3fShall, in consideration of similar agreements by others in the same fiscal year, promise and agree to invest in the capital of this corporation (revolving fund) as requested by the board of directors [specification of determinant]of the agricultural products sold, consigned, or otherwise delivered to the corporation, which amount is made deductible from the sales proceeds otherwise payable to the patron, and, in addition, such further sum or sums of money as the board of director
s may specify, provided, however, that the patron's obligation to invest in the capital in any fiscal year of this corporation, in addition to the rate prescribed above, shall be limited to an amount equal to the patron's share of such patrons' net margins for the fiscal year next 
preceding the fiscal year in which such investment is required and shall be proportionate to the investments required of other patrons. It is the intention and agreement of this corporation and its patrons with each other that, as the board of directors s
hall deem the capital to be necessary to repurchase or retire previously issued certificates of indebtedness or capital interests, its several patrons shall, subject to the foregoing limitations, furnish such additional capital as may be required and shall 
do so substantially in proportion to their respective patronage in the preceding fiscal year.
\'3fSection 2. Computation of Patrons' Net Margins. 
\'3fThe patrons' net margins, calculated on the basis of each fiscal year, shall be computed as follows:
\'3f(a). Gross receipts. 
\'3fAll proceeds of all sales of products marketed for patrons, plus all sums received for supplies and equipment procured for patrons, plus all sums received from all other sources except loans or contributions to this corporation or investments in its capit
al, will be deemed to be the &ldquo;\'93
gross receipts.&rdquo;\'94\'3f(b). Patrons' net margins. 
\'3fThis corporation will deduct from the gross receipts the sum of the following items:
\'3f(1). 
\'3fAll costs and expenses and other charges that are lawfully excludible or deductible from this corporation's gross receipts for the purpose of determining the amount of any net margin of this corporation; and
\'3f(2). 
\'3fAn amount equal to [percentage of balance of gross receipts]&percnt;%of the balance of the gross receipts that remain after first having deducted from it the items referred to in Clause (1).
\'3fIf, in any fiscal year, this corporation incurs a net operating loss that is recognizable for tax purposes, the board of directors will have full authority to charge off such loss against net margins of future years or against revolving fund credits or in
such other manner as will afford the corporation the maximum benefit for tax purposes.
\'3fThe balance of the gross receipts that remain after the foregoing deductions will be deemed to be the &ldquo;\'93patrons' net margins.&rdquo;\'94\'3fThe amount deducted pursuant to Clause (2) above will be set aside in a reserve and apportioned to patrons in accordance with their patronage during the fiscal year, provided that, when the reserve reaches the sum of $
[dollar amount of reserves], the board of directors in its discretion may either: (a) make no further deductions; or (b) retire such amounts of the reserve as it considers may be in excess of the corporation's reserve needs. Such retirement will be accomplished by paying off in ful
l or pro rata patrons' apportioned interests, by years, the oldest being paid first.
\'3fThe patrons' respective shares of the patrons' net margins will be computed on the basis of their respective patronage of, and the net margins resulting from the operations of, the various pools or departments of this corporation and will be in proportion
to the quantity or value of the products delivered by, or supplies or equipment procured for, such patrons.
\'3fSection 3. Payment of Patrons' Net Margins. 
\'3fEach patron's share of the patrons' net margins will be payable to the patron in cash at the close of each fiscal year, but the legal offset of the payments due a patron against the obligation of such patron to subscribe for capital, as provided in Sectio
n 1(b) of this ARTICLE X, will constitute full and complete discharge of the obligation of the corporation to make payment as provided in these bylaws.
\'3fSection 4. Lien. 
\'3fThis corporation will have a first lien on the interest of each patron in the patrons' net margins for all indebtedness of such patron to this corporation.
\'3fARTICLE XI  REVOLVING FUND
\'3fSection 1. Purpose. 
\'3fThis corporation will establish and maintain a revolving fund for the purpose of acquiring and maintaining adequate capital to finance its business.
\'3fSection 2. Investment in Fund. 
\'3fThis corporation may require investment in its revolving fund as provided in ARTICLE X, Section 1(b) of these bylaws. Proper entries will be made on the corporation's books and records so that the new credit to each holder of an interest in the revolving 
fund in each year can be ascertained at any time. This corporation may issue revolving fund certificates to evidence credits in such fund, and the certificates may be in such form and contain such terms and conditions not inconsistent with this ARTICLE XI
as the board of directors may prescribe.
\'3fSection 3. Operation. 
\'3fInvestments in the revolving fund need not be segregated from, but on the contrary may be invested in or commingled with, any other assets of this corporation. No dividend, interest, or any other income will be declared or paid on account of any net credi
ts in the revolving fund. This corporation will have a first lien on each revolving fund credit for all indebtedness of the holder thereof to this corporation.
\'3fSection 4. Repayment. 
\'3fWhen, in the judgment of the board of directors, the net balance in the revolving fund exceeds the amount of capital reasonably needed by the corporation, it will apply such excess to the retirement, in full or pro rata, of all the net credits in the revo
lving fund, provided that such certificates will be retired in the order of issuance by years and there will be no discrimination between investments received in the same fiscal year. Notwithstanding any other provision of this section, the board of direc
tors, in its discretion, may retire any net credits at any time when the holder: (a) dies; (b) otherwise ceases to be a producer; or (c) moves from the territory served by the corporation.
\'3fSection 5. Transfer. 
\'3fAny assignment or transfer of any revolving fund will not be binding on this corporation without the consent of the board of directors or until it shall have been entered in the books of this corporation.
\'3fARTICLE XII  INITIATIVE, REFERENDUM, AND RECALL
\'3fSection 1. Regulations for Mail Ballots. 
\'3fRegulations for conducting mail ballots under this section shall be made by the board of directors.
\'3fSection 2. Petition for Director's Recall; Balloting. 
\'3fAny director may be recalled by the following method: On petition of at least [percentage of voting members]&percnt;%of the voting members, accompanied by written charges, the secretary or other officer specified in the petition shall conduct a recall election at a regular or special meeting. The ballot shall contain two statements of not more than [number of words]words each, one by a proponent and one by an opponent of the recall. The director against whom the charges have been brought must be given at least 20-days written notice of the time, place, and object of any such meeting and of the charges to be brought, and the director shall be given an opportunity to be heard at the meeting and to present and cross-examine witnesses. A three-fourths vote of
at least [percentage of voting members]&percnt;%of the entire membership shall determine the election.
\'3fSection 3. Referendum on Certain Motions. 
\'3fOn demand of one-third of the entire board of directors made immediately and so recorded at the same meeting at which the original motion was passed, any matter that has been approved or passed on by the board must be referred to the entire membership for
a decision at the next regular or special meeting.
