members at any regular membership meeting. The board of directors must notify the membership of the proposed amendment at least [number of days]-days prior to the next membership meeting, and the proposed amendment must be voted on at the next membership meeting.
\'3fSection 2. Adoption. 
\'3fAmendment to these bylaws may be adopted by the written consent of members entitled to exercise a majority of the voting power or by the vote of a majority of a quorum at a meeting of members duly called. Such meeting shall be considered duly called if th
e proposed amendment has been submitted in writing at the next preceding regular membership meeting or has been submitted to the members by mail at least [number of days]-days prior to the membership meeting at which a vote on the amendment is taken.
\'3fARTICLE XIV  DISSOLUTION
\'3fThis cooperative may be dissolved only by a [fraction of votes]vote of all voting members of the entire membership at any regular or special meeting when due notice of such action has been given in advance. On dissolution, any reserves of the cooperative in excess of its financial obligation, including debts and exp
enses, par value of invested capital paid on subscriptions, patronage dividends and membership capital, shall be turned over to such recognized cooperative organization as the membership may det
ermine.
