Notes to FormTax Notes 
\'3fSound tax planning for specialized entities such as a cooperative usually advocates inclusion in the articles of incorporation or bylaws of the goal of complying with the tax requirements. That demonstrates that the purpose of the entity is to meet the ta
x requirements and makes easier its claim to the specialized tax treatment afforded by the Internal Revenue Code. As an example, the key to allowance of the patronage dividend exclusion is a pre-existing enforceable obligation of the co-op to distribute i
tspatronage earnings among its patrons. \'3f
26 U.S.C.A. &s;\'a71388(a)(2). Listing this in the bylaws not only shows that the corporation plans to do this but also makes it a pre-existing obligation of the corporation. If this should not be covered elsewhere, it nevertheless provides compliance with the Code.
\'3fFurther examples of the policy of covering tax requirements in the bylaws may be found in the foregoing bylaws. See, for example, Sec 4(h) of ARTICLE III and Secs 1(c), (e), and (h) of ARTICLE IV.
