\'3f\'3fSection 1. Election Districts. 
\'3fThe territory in which the corporation has members shall be divided into districts. Unless and until changed as herein provided, there shall be [number of districts]districts, and the respective districts and their boundaries shall be those established by resolution of the board of directors.
\'3fSection 2. Change of Election Districts. 
\'3fBy resolution adopted by majority vote, the board of directors may, from time to time: (a) without affecting the number of districts, change the boundaries of one or more districts by adding to it territory not included up to that time within any district
or by adding to one district territory theretofore embraced within another or by excluding from a district a part of its territories; or (b) change the number of districts by redistricting the entire territory, discontinuing a district, or merging a dist
rict with one or more districts or by any other means.
\'3fSection 3. Election of Directors by District and At-Large. 
\'3fThere shall be as many directors as there are districts, one director to be elected by the members of each district, provided, however, that when the number of districts is an even number, there shall be one additional director to be known as a director-a
t-large and to be elected by all members of the corporation. Each director must be a member of the corporation and engaged in [description of activity]on a commercial scale or must be the authorized representative of a member so engaged if the latter is no
t a single natural person. A district director must be a resident of the district in which he or she is elected or for which he or she is appointed.
\'3fSection 4. Effect on Tenure of Directors by Change in Districts. 
\'3fWhenever a district is discontinued, the director representing that district shall cease to be a director and the office shall be discontinued. Whenever a new district is created, a director to represent it shall be selected in the manner herein provided 
in case of a vacancy. The same procedure is applicable when the creation of a new district necessitates the selection of a director-at-large. Notwithstanding the simultaneous discontinuance and creation of districts, if a director-at-large is still necess
ary as before such changes, the person then serving as such director shall continue to hold that office, subject to any other relevant provisions of the bylaws. Any question as to the effect of any changes made as herein provided in district boundaries or t
he number or identity of districts shall be conclusively determined by the board of directors.
\'3fSection 5. Nomination of Directors. 
\'3fNominations for directors, either at-large or for a district, shall be made by petition addressed to the secretary of the corporation requesting that the secretary place upon the ballot the name of the person so nominated. Such a petition nominating a dir
ector-at-large shall be signed by not less than [fraction of members]members of the corporation. Such a petition nominating a district director shall be signed by not less than [fraction of members]of members from that district.
