\'3f\'3fIn the event of a substantial loss to the corporation from any cause whatsoever, the board of directors may, in its discretion, charge all or a part of such loss to current operating expenses. Any part of such loss not charged to current operating expense
s (up to the whole amount of such loss) may, in the board's discretion, be: (1) charged ratably and proportionately against revolving fund credits for the year during which the loss occurred; or (2) charged ratably and proportionately against all revolvin
g fund credits (for all years), in which event such loss may be apportioned between revolving funds.
\'3fIn the event any loss is charged against revolving fund credits, such credit shall be reduced by its proportionate part of the loss and the records pertaining to the revolving fund changed accordingly. Notwithstanding anything to the contrary contained el
sewhere in these bylaws, there shall be payable in respect to any credit against which a loss has been charged only the difference between the amount of the credit as originally entered and the portion of the loss charged to such credit.
\'3fThe board of directors shall have power to determine when a substantial loss has occurred, and its determination shall be conclusive. In making such determination, the board may consider losses from bank suspension, uncollected accounts, fire, explosion, 
accident, or other calamity and losses arising from any other source or for any other reason.
