32:49. Form drafting principles
Research References\'3fWest's Key Number Digest, Agriculture &key;6\'3fWest's Key Number Digest, Associations &key;128, 129\'3fTo be effective, a marketing contract must satisfy such basic requirements of all contracts as competent parties who express definite assent in the form required, sufficient consideration, and a legal object or purpose.11\'3fResearch ReferencesValidity and binding effect of marketing contracts, \'3fAm. Jur. 2d, Cooperative Associations &s;\'a731.
\'3fA marketing contract, due to its complexity, should always be in writing and should observe formalities that are often omitted in the simpler forms of contract. Because such contracts are construed strictly, extreme care should be taken to avoid any ambig
uities in the contract's provisions.22\'3fResearch ReferencesPower of cooperatives to enter into marketing contracts, \'3f
N.Y. Jur. 2d, Business Relationships &ss;\'a7\'a7477to 481.
Marketing contracts, \'3fAm. Jur. 2d, Cooperative Associations &ss;\'a7\'a730 to 48.
Practice Tip:
\'3f
Marketing contracts are sometimes attached to preorganization agreements in order that they may be signed by prospective members prior to incorporation of the cooperative. In such circumstances, the marketing agreement is executed contemporaneously by the
prospective member with the execution of the organization agreement and as a part of the entire contract.
\'3fMarketing contracts entered into prior to the formation of a producers' marketing corporation are valid and binding upon the producers as signers after the formation of the corporation.33\'3f\'3fSee \'3fCastorland Milk & Cheese Co. v. Shantz, 179 N.Y.S. 131 (Sup 1919).
Practice Tip:
\'3f
A cooperative marketing agreement may create either of two relationships with respect to the products to be marketed under it: (1) a relationship of buyer and seller (a sales contract); or (2) the relationship of principal and agent between the member and
the association (an agency contract). The nature of the relationship and the type of contract created depends upon the intention of the parties, as evidenced by the provisions of the contract, and as viewed in the light of the articles of incorporation o
r charter, the bylaws, and the circumstances of the particular case, including applicable statutory provisions.44\'3f\'3fSee \'3fPyrke v. Brudno, 243 A.D. 493, 278 N.Y.S. 353 (3d Dep't 1935), aff'd, 269 N.Y. 652, 200 N.E. 42 (1936)(milk producers' cooperative contract to sell milk to a milk dealer was one of agency and not of purchase and sale).
