\'3fA farmer's cooperative must limit the amount of business itdoes with nonmembers. It may market products or purchase supplies and equipment for nonmembers only if: (i) the value does not exceed the value of the products, supplies, and equipment of members; and (ii) the value of the purchases made for those who ar
e neither members nor producers does not exceed 15&percnt;%of total purchases. \'3f26 U.S.C.A. &s;\'a7521(b)(4). In addition, buying and selling for its own profit, such as selling by-products of purchases made for members to nonmembers, will disqualify a cooperative, even if sales are minimal.
\'3fThis explains the inclusion of a provision like that of Section 12 in the above agreement, which makes the contract itself an application for membership and an acceptance of that application.
