\'3f\'3fAgreement made [date of agreement], between [name of packer], of [address of packer], [name of city], [name of county]
, State of New York, referred to as &ldquo;\'93Packer,&rdquo;
\'94and [name of corporation], a cooperative marketing corporation having its principal place of business at [address of corporation], [name of city], [name of county]
, State of New York, referred to as &ldquo;\'93Corporation.&rdquo;
\'94\'3fRECITALS
\'3f1. 
\'3fCorporation is a cooperative marketing corporation organized under the laws of the State of New York.
\'3f2. 
\'3fCorporation has secured crop contracts for numerous growers in the State of New York.
\'3f3. 
\'3fAs a result of those contracts, Corporation will market a large proportion of the crop of [name of fruit], referred to in this agreement as &ldquo;\'93fruit,&rdquo;\'94produced in the State of New York.
\'3f4. 
\'3fPacker is in the business of handling, processing, and packaging such fruit and desires to secure an adequate and certain supply of fruit for handling, processing, and packaging and to save the labor and expense of soliciting orders or contracts from the 
individual producers of such fruit.
\'3f5. 
\'3fCorporation is empowered to buy and sell the fruit of its members. In consideration of the above and the mutual promises of the parties to this contract, it is agreed as follows:
\'3f1. SALE OF FRUIT
\'3fDuring the term of this contract, Corporation shall sell to Packer for handling, processing, and packaging in its plants, and Packer shall purchase and accept from Corporation for handling, processing, and packaging in its plants such fruit grown by membe
rs of the Corporation as follows:
\'3fA. 
\'3fAll such fruit grown by certain members of the Corporation during the [identification of year]season as set forth and identified in Exhibit [designation of exhibit]attached and made a part of this contract.
\'3fB. 
\'3fAll such fruit grown during the [identification of year]season by the members of the Corporation identified on Exhibit [designation of exhibit]attached and made a part of this contract, except to the extent that such Exhibit [designation of exhibit]may be amended by mutual agreement of Corporation and Packer.
\'3f2. TERM OF CONTRACT
\'3fThis contract shall cover the crops of fruit grown during the [designation of season]season and the [designation of season]season.
\'3f&ldquo;\'93Season,&rdquo;\'94as used in this agreement, means that period commencing with the [ordinal number of day]day of [name of month]of one calendar year and ending with the [ordinal number of day]day of 
[name of month]of the following calendar year.
\'3f3. SEPARATE LISTING OF EACH GROWER
\'3fThe ability of Corporation to deliver the fruit hereby sold to Packer is based and dependent on Corporation's crop contract with its grower&ndash;-members. If Corporation is unable to perform this contract because of any failure in performance of any of the provisions of the grower&ndash;-members' contracts to Corporation or by clauses beyond Corporation's direct control, the mutual obligations and terms of this contract will not be affected, changed, or released as to any fruit from any other grower that i
s listed for the current crop year to Packer under this contract. For purposes of this section, each grower herein listed to packers shall be deemed listed to Packer under the terms of this contract separately from every other grower&ndash;-member listed to Packer under the terms of this contract, as though each grower&ndash;-member were covered by a separate contract with Packer.
\'3f4. INABILITY OF PACKER TO PERFORM
\'3fIn case of fire, boiler explosion, interruption of power, strikes or other labor disturbances, lack of transportation facilities, shortage of labor supplies, perils to the city, floods, earthquakes, action of the elements, invasion, war, riot, insurrectio
n, rebellion, interference of civil or military authorities, enactment of legislation, or any unavoidable casualty or cause beyond the Packer's control, affecting the conduct of Packer's business to the extent of preventing or unreasonably restricting, re
ceiving, handling, processing, or packaging operations, including any obligation on Packer's part to transfer the fruit covered by this agreement or to furnish bins therefor, Packer will be excused for performance under this contract during the period that 
Packer's business or packaging operations are so affected. Packer may, during such period, accept such portion of the fruit as Packer has informed Corporation in its judgment it can economically handle.
\'3fPacker shall immediately give Corporation written notice of Packer's inability to perform and the specific cause or causes thereof. In any event, Packer shall pay, according to contract, for all fruit received by Packer.
\'3f5. DIVERSION TO OTHER PACKERS
\'3fWith respect to the fruit that Packer has advised Corporation of its inability to handle pursuant to Section 4, Corporation retains the right, without liability of any kind or character to Packer, to divert the fruit to a Packer who is able to accept it i
n order to prevent economic waste to the growers and consumers.
\'3f6. FAILURE OF ASSOCIATION TO DELIVER
\'3fIf, for the same causes enumerated in Section 4, the farming operations of any grower&ndash;-member of fruit covered by this agreement are so affected that such member or members are unable to make complete delivery of the fruit, Corporation shall make every reasonable effort to complete deliveries under this contract. However, Corporation shall 
be excused from the performance of that part of the contract that it is unable to perform because of these causes during the period the member's farming operations are so affected.

\'3fCorporation shall not be liable for the failure to deliver fruit destroyed by rain, frost, flood, or other similar casualties.
\'3f7. INDIVIDUAL AGREEMENTS WITH PACKER
\'3fMembers of Corporation may enter into individual agreements with Packer with respect to delivery of fruit and advances for growing, harvesting, and other costs as indicated below. The form of the agreements between individual grower&ndash;-members of Corporation and Packer shall be in the form outlined in Exhibit [designation of exhibit]attached and made a part of this contract.
\'3fPacker shall furnish to each such grower&ndash;-member a copy of the agreement at the time of its execution.
\'3f8. PAYMENT OF EXPENSES
\'3fPacker shall pay expenses of delivering, weighing, inspecting, and receiving of all fruit subject to this agreement in accordance with its present customs and practices in the industry.
\'3f9. INSPECTION BY ASSOCIATION
\'3fCorporation shall have the right at any time by its authorized agents to examine and inspect any fruit held by Packer on account of Corporation under memorandum receipt or other similar arrangement.
\'3f10. SETTLEMENT STATEMENT
\'3fPacker shall furnish to each grower&ndash;-member of Corporation covered by this contract and to Corporation itself at the time of final settlement for fruit delivered under this contract for each crop year a copy of the settlement statement together with financial calculations indicating grower's
returns.
\'3f11. FURNISHING OF BINS
\'3fPacker shall use its best efforts to furnish the grower&ndash;-members of Corporation bins in clean and good repair for the purpose of delivering fruit in accordance with its present customs and practices in the industry.
\'3f12. FAILURE TO SUPPLY BINS
\'3fIf Packer shall neglect or fail to meet the reasonable bin requirements of grower&ndash;-members of Corporation covered by this agreement, Packer shall pay Corporation damages sustained by the grower&ndash;-members and Corporation on account of such neglect or failure.
\'3fPacker shall not be liable for damages when Packer cannot supply bins because of strikes, fire, acts of God, or other causes beyond Packer's control and of which notice has been given to Corporation under Section 4 of this contract. Packer shall not be li
able for damages when Packer has allocated bins on a reasonable basis among grower&ndash;-members of Corporation and other growers from which Packer purchases fruit.
\'3f13. QUALITY AND GRADE OF FRUIT
\'3fAll fruit delivered under this contract shall be of the quality and grades in effect for such fruit as may be developed and established by Packer or Corporation with approval of the other. In the event Packer establishes various grades by which different 
prices of grade may be paid grower&ndash;-members, Corporation may establish prices for its grower&ndash;-members on the basis of grade in accordance with the provisions of Sections 16 through 22.
\'3f14. COMPLIANCE WITH FAIR LABOR STANDARDS ACT
\'3fCorporation guarantees that all of the fruit subject to this contract was or will be produced and delivered in compliance with all applicable standards of the Fair Labor Standards Act (\'3f29 U.S.C.A. &ss;\'a7\'a7201 et seq.), as amended.
\'3f15. BREACH OF GUARANTIES
\'3fShould Corporation breach any of the guaranties in Sections 13 or 14, Packer may, at its option, refuse to accept delivery. Packer shall have no obligation to pay for the crop, and Corporation may dispose of the crop free of the contract.
\'3f16. TONNAGE TO BE SOLD
\'3fCorporation shall sell to Packer and Packer shall purchase and accept from Corporation the following tonnage of such fruit: [number of tons of fruit]grown by members of Corporation covered by this contract at the price or prices indicated below.
\'3f17. FAILURE TO AGREE ON PRICE
\'3fIf the parties to this agreement fail to agree on a price or prices under Sections 18 and 19 of this contract, Packer shall pay and Corporation shall accept for all fruit delivered to Packer by Corporation or the growers it represents a reasonable price, 
as that term is used in Section 18.
\'3f18. ASCERTAINMENT OF REASONABLE PRICE
\'3fThe reasonable price referred to in Section 17 shall be ascertained in the following manner:
\'3fCorporation shall announce an opening price or prices that Corporation believes to be a reasonable price for each variety and grade or grades for any crop year on or before the [ordinal number of day]day of [name of month]of such year. Such announcement shall be made on the basis of consultations with individual packers and an examination by Corporation of all available economic and supply data that influence the sale and purchase price of such fruit.
\'3fPacker shall advise Corporation within [number of days]days after receipt of the announced opening price or prices for the [name of fruit]season of its acceptance or rejection of the price or prices. On the acceptance of the announced price or prices by [fraction of packers]in number of packers who purchase fruit from Corporation and those aggregate purchases represent [fraction of estimated total tonnage]of the estimated total tonnage of fruit offered for sale by Corporation under contracts of sale similar to this agreement, such opening price or prices shall be the reasonable price, provided, however, that among the requisite [fraction of packers]
of packers who accept the announced price or prices, there shall be included one Packer whose estimated purchase of fruit tonnage under contract with the Corporation for the season shall be one of the [number of largest estimated tonnages]largest estimated tonnages under contract between Corporation and any purchaser for the season.
\'3fFor purposes of the following calculation, Corporation for the [identification of year]season shall refer to the estimated tonnage set forth in Exhibit [designation of exhibit]attached to this contract and similar exhibits to similar agreements with other packers of such fruit. For the [identification of year]season, Corporation shall refer to the list and estimates furnished to Packer and to other packers for the season in accordance with Sections 1 and 2 of this contract and similar agreements.
\'3f19. NONACCEPTANCE OF OPENING PRICE
\'3fIf the requisite packers do not signify their acceptance of the announced opening price or prices within [number of days]
days after the announcement, Corporation will hold further consultations with the individual packers and reconsider the data above referred to on or before the 
[ordinal number of day]day of [name of month], the Corporation will make a second announcement of price or prices that Corporation believes to be a reasonable price, which price or prices may be the same as or different from those previously announced. Such price or prices set forth in the second announcement will be the reasonable price, if such price or prices are accepted within [number of days]days after the second announcement by the requisite packers.
\'3f20. ARBITRATION TO ESTABLISH PRICE
\'3fIf the requisite packers do not signify their acceptance of the price or prices announced by Corporation under Sections 18 and 19, those sections will be null and void and of no further effect. The price to be paid under this contract will then be determi
ned by three arbitrators. The decision of the majority of the arbitrators will be binding on the parties to this contract and will be final and conclusive as to a reasonable price for the then-current crop year.
\'3fThe arbitrators will be selected in the following manner: [specification of selection method].
\'3fWithin [number of days]days following the appointment of the arbitrators, the arbitrators will meet to conduct a hearing to determine what a reasonable price will be for the current crop year. Within [number of days]days of the close of such hearing, the arbitrators will report their decision, which, when signed by a majority of them, will be final and not subject to review.
\'3f21. DAMAGES FOR FAILURE TO RECEIVE FRUIT
\'3fIf Packer, for any reason other than a price dispute, fails, neglects, or refuses, without just legal cause, to receive prior to the [ordinal number of day]day of [name of month]of any crop season covered by this agreement any fruit sold under this contract and that Packer is obligated by this agreement to receive, Packer will pay all reasonable damages caused by such failure unless the receiving date is extended by mutual agree
ment of grower-members, Packer, and Corporation.
\'3f22. PAYMENT FOR FRUIT
\'3fUnless otherwise agreed upon by grower and Packer, payments to grower-members of Corporation who deliver fruit under this agreement will be made by Packer within [number of days]days after full delivery and establishment of price and on demand for payment by grower-members.
\'3fThe division of payments for fruit will be as follows: [percentage of payments due to grower-member]&percnt;%of the payments due on delivered fruit shall be paid directly from Packer to grower-members, and [percentage of payments due to corporation]&percnt;%of the payments due on delivered fruit and the entire service charge, as referred to in Section 25 of this contract, shall be paid to Corporation in accordance with the terms of that section.
\'3fIf Packer, for any reason, fails to pay for the fruit or any other charges that Packer is obligated by this agreement to pay, either to grower&ndash;-members directly or to Corporation, on the date or dates agreed upon, interest at [percentage rate of monthly interest]&percnt;%per month or any part of the month on the unpaid balance will commence to run immediately on such default.
\'3f23. DEFAULT BY PACKER
\'3fIf Packer shall default or fail in the performance of any of its obligations under this contract, Corporation may stop any further deliveries to Packer and may deliver the balance of fruit elsewhere. This right may be exercised at any time although Corpor
ation has permitted deliveries to Packer to continue after such default or failure. Continuance of delivery after Packer's default or failure in the performance of any of its obligations shall not be construed as a waiver of Corporation's right to stop de
liveries. Such delivery of fruit elsewhere shall not be a waiver or release of any liability of Packer for default or failure in performance. Packer may be held liable to Corporation or its grower-members for damages suffered as a result of such default.

\'3f24. DEFAULT BY CORPORATION
\'3fIf Corporation shall default or fail in the performance of any of its obligations under this contract, Packer may stop any further acceptance of fruit under the contract. This right may be exercised at any time although Packer has accepted delivery from C
orporation members after such default or failure in the performance of any of its obligations under this contract. Continuance of delivery after Corporation's default or failure will not be construed as a waiver of Packer's right to stop receiving. Termin
ation of receiving shall not be a waiver or release of any liability of Corporation for default or failure in performance. Corporation may also be held liable to Packer for damages suffered as a result of the default.
\'3f25. SERVICE CHARGE
\'3fPacker recognizes that the organization and continued existence of Corporation relieves Packer of the trouble, labor, and uncertainty of soliciting and obtaining separate contracts with individual growers for the purchase and sale of fruit. In considerati
on thereof, Packer shall pay to Corporation, over and above the market price designated in this agreement, a service charge of $[dollar amount of service charge]per ton for all fruit delivered to Packer under this contract and for all fruit delivered by ag
ency growers who are members of Corporation. The service charge shall not be construed to be a part of the purchase price under this agreement.
\'3f26. SALE TO OTHER PACKER
\'3fIf, during the terms of this agreement, Corporation sells to any Packer fruit of its grower-members at a price less than the price specified in Sections 16 through 21, Corporation will pay to Packer, on all fruit purchased under this contract, the differe
nce between the price established in this agreement and the lowest price at which Corporation shall make sales to other packers.
\'3f27. DISAGREEMENT
\'3fIn case any disagreement arises between the parties to this contract, either as to procedures under or interpretations of disagreement, there shall be an arbitration in the manner and under the conditions provided in Section 20.
\'3f28. PURCHASE AT DIFFERENT PRICE
\'3fIf Packer, during or for any season under this contract, has purchased or has agreed to purchase any fruit from a grower-member of Corporation, from anyone other than Corporation, or from anyone other than a member of Corporation at a higher price or pric
es than established in this agreement in accordance with Sections 16 through 21, either upon the basis of grade or without grades, Packer will pay to Corporation for fruit purchased under this contract the highest price that Packer has paid or has agreed 
topay or shall have paid or shall have agreed to pay for fruit so purchased from anyone.
\'3fIn computing the higher purchase price so paid or agreed to be paid, there shall be included any bonuses, premiums, hauling or loading allowances, expenses of special services of any character that may be rendered by Packer or at its expense, and any sums
paid or agreed to be paid by Packer for any other designated purpose than payment of purchase price. Nothing contained in this section shall apply to sales of fruit between packers.
